pragma solidity ^0.4.23;

import "./Migrations.sol";
import "./safeMath.sol";

contract ERC721Interface {

    using SafeMath for uint256;

    // ERC20 compatible functions
    function name() public view returns (string);
    function symbol() public view returns (string);
    function totalSupply() public view returns (uint256);
    function balanceOf(address _owner) public view returns (uint);

    // Functions that define ownership
    function ownerOf(uint256 _tokenId) public view returns (address);
    function approve(address _to, uint256 _tokenId) public;
    function takeOwnership(uint256 _tokenId) public;
    function transfer(address _to, uint256 _tokenId) public;
    function tokenOfOwnerByIndex(address _owner, uint256 _index) public view returns (uint);
    
    // Token metadata
    function tokenMetadata(uint256 _tokenId) public view returns (string infoUrl);
    
    // Events
    event Transfer(address indexed _from, address indexed _to, uint256 _tokenId);
    event Approval(address indexed _owner, address indexed _approved, uint256 _tokenId);
}

contract ERC721 is ERC721Interface, Migrations {
    uint256 public totalSupply;
    uint256 public decimals;
    string public name;
    string public symbol;

    mapping(address => uint256) balances;
    mapping(uint256 => address) tokenOwnership;
    mapping(uint256 => bool) tokenExists;
    mapping(address => mapping(address => uint256)) allowed;

    constructor() public {
        name = "";
        symbol = "";
        totalSupply = 1e9 * 10 ** decimals;
    }

    function name() public view returns (string) {
        return name;
    }

    function symbol() public view returns (string) {
        return symbol;
    }

    function totalSupply() public view returns (uint256) {
        return totalSupply;
    }

    function balanceOf(address _who) public view returns (uint256) {
        return balances[_who];
    }

    function ownerOf(uint256 _tokenId) public view returns (address) {
        require(tokenExists[_tokenId]);
        return tokenOwnership[_tokenId];
    }

    function approve(address _to, uint256 _tokenId) public {
        require(tokenExists[_tokenId]);
        require(tokenOwnership[_tokenId] == msg.sender);
        allowed[msg.sender][_to] = _tokenId;
        emit Approval(msg.sender, _to, _tokenId);
    }

    function takeOwnership(uint256 _tokenId) public {
        require(tokenExists[_tokenId]);
        address oldOwner = tokenOwnership[_tokenId];
        address newOwner = msg.sender;
        require(allowed[oldOwner][newOwner] == _tokenId);
        tokenOwnership[_tokenId] = newOwner;
        balances[newOwner].safeAdd(1);
        balances[oldOwner].safeSub(1);
        emit Transfer(oldOwner, newOwner, _tokenId);
    }

    function transfer(address _to, uint256 _tokenId) public {
        require(tokenExists[_tokenId]);
        require(tokenOwnership[_tokenId] == msg.sender);
        tokenOwnership[_tokenId] = _to;
        balances[_to].safeAdd(1);
        balances[msg.sender].safeSub(1);
        emit Transfer(msg.sender, _to, _tokenId);
    }

    // function tokenOfOwnerByIndex(address _owner, uint256 _index) public view returns (uint) {

    // }
    
    // Token metadata
    // function tokenMetadata(uint256 _tokenId) public view returns (string) {

    // }

}
